import pkg from "express";
import path from "path";
const app = pkg();
const port = 8080

app.get('/', (req, res) => {
    res.send('Hello');
    res.sendFile(path.join(__dirname, './index.html'));
})

app.listen(port, () => {
    console.log(`Example app listening at http://localhost:${port}`)
})
